import React from "react";

const Login = (props) => {
  const {
    email,
    setEmail,
    password,
    setPassword,
    handLogin,
    handleSignUp,
    hasAccount,
    setHasAccount,
    emailError,
    passwordError,
  } = props;

  return (
    <section>
      <div>
        <label>Username</label>
        <input
          type="text"
          autoFocus
          required
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <p>{emailError}</p>
        <label>Password</label>
        <input
          type="password"
          required
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
        <p>{passwordError}</p>
        {/*
         * Button, account checker
         */}
        <div>
          {hasAccount ? (
            <>
              <button>Sign In</button>
              <p>
                Don't have an account? <span>Sign up</span>
              </p>
            </>
          ) : (
            <>
              <button>Sign up</button>
            </>
          )}
        </div>
      </div>
    </section>
  );
};

export default Login;
